using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace UIKit{    /// <summary>    /// A UIReferenceLibraryViewController object provides a dictionary service to look up the definition of a word or term from within an app. It should not be used to display wordlists, create a standalone dictionary app, or republish the content in any form.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIReferenceLibraryViewControllerClassRef/index.html#//apple_ref/occ/cl/UIReferenceLibraryViewController"/>    [iOSVersion(5)]    public class UIReferenceLibraryViewController : UIViewController//, AnyObject, NSCoding, NSExtensionRequestHandling, NSObjectProtocol, UIAppearanceContainer, UIContentContainer, UIStateRestoring, UITraitEnvironment    {        /// <summary>        /// Returns whether a definition is available for the given term.        /// </summary>        /// <param name="term">The term to be defined.</param>        [iOSVersion(5)]        [Export("dictionaryHasDefinitionForTerm")]        public static bool DictionaryHasDefinitionForTerm(string term) { return default(bool); }                /// <summary>        /// Initializes a newly created reference-library view controller to display the definition of the given term.        /// </summary>        /// <param name="term">The term to define.</param>        [iOSVersion(5)]        public UIReferenceLibraryViewController(string term) { }    }}